      "path": "src/server.js",
      "content": ""use strict";

const http = require('http');
const fs = require('fs');
const path = require('path');
const url = require('url');
const crypto = require('crypto');

function loadData(dataPath) {
  if (fs.existsSync(dataPath)) {
    const data = fs.readFileSync(dataPath, 'utf8');
    return JSON.parse(data);
  }
  return { todos: [] };
}

function saveData(dataPath, data) {
  fs.writeFileSync(dataPath, JSON.stringify(data), 'utf8');
}

function createServer({ dataPath }) {
  const db = loadData(dataPath);

  function findTodo(id) {
    return db.todos.find(todo => todo.id === id);
  }

  function removeTodo(id) {
    const index = db.todos.findIndex(todo => todo.id === id);
    if (index !== -1) {
      db.todos.splice(index, 1);
      saveData(dataPath, db);
      return true;
    }
    return false;
  }

  function updateTodo(id, changes) {
    const todo = findTodo(id);
    if (todo) {
      Object.assign(todo, changes);
      saveData(dataPath, db);
      return todo;
    }
    return null;
  }

  const server = http.createServer((req, res) => {
    const parsedUrl = url.parse(req.url, true);
    const method = req.method.toUpperCase();
    const pathname = parsedUrl.pathname;
    let id = pathname.split('/')[2];

    if (pathname === '/health' && method === 'GET') {
      res.writeHead(200, { 'Content-Type': 'application/json' });
      res.end(JSON.stringify({ ok: true }));
      return;
    }

    if (pathname === '/openapi.json' && method === 'GET') {
      const openApiSpec = fs.readFileSync(path.join(__dirname, '../../openapi.json'), 'utf8');
      res.writeHead(200, { 'Content-Type': 'application/json' });
      res.end(openApiSpec);
      return;
    }

    if (pathname === '/todos' && method === 'GET') {
      res.writeHead(200, { 'Content-Type': 'application/json' });
      res.end(JSON.stringify({ ok: true, todos: db.todos }));
      return;
    }

    if (pathname === '/todos' && method === 'POST') {
      let body = '';
      req.on('data', chunk => {
        body += chunk.toString();
      });
      req.on('end', () => {
        try {
          const { title } = JSON.parse(body);
          if (!title) {
            res.writeHead(400, { 'Content-Type': 'application/json' });
            res.end(JSON.stringify({ ok: false, error: 'Title is required' }));
            return;
          }
          const newTodo = {
            id: crypto.randomUUID(),
            title,
            done: false,
            createdAt: new Date().toISOString()
          };
          db.todos.push(newTodo);
          saveData(dataPath, db);
          res.writeHead(201, { 'Content-Type': 'application/json' });
          res.end(JSON.stringify({ ok: true, todo: newTodo }));
        } catch (e) {
          res.writeHead(400, { 'Content-Type': 'application/json' });
          res.end(JSON.stringify({ ok: false, error: 'Invalid JSON body' }));
        }
      });
      return;
    }

    if (pathname.startsWith('/todos/') && method === 'GET') {
      const todo = findTodo(id);
      if (!todo) {
        res.writeHead(404, { 'Content-Type': 'application/json' });
        res.end(JSON.stringify({ ok: false, error: 'TODO not found' }));
        return;
      }
      res.writeHead(200, { 'Content-Type': 'application/json' });
      res.end(JSON.stringify({ ok: true, todo }));
      return;
    }

    if (pathname.startsWith('/todos/') && method === 'PATCH') {
      let body = '';
      req.on('data', chunk => {
        body += chunk.toString();
      });
      req.on('end', () => {
        try {
          const changes = JSON.parse(body);
          if (!changes.done) {
            res.writeHead(400, { 'Content-Type': 'application/json' });
            res.end(JSON.stringify({ ok: false, error: 'Done status is required' }));
            return;
          }
          const todo = updateTodo(id, changes);
          if (!todo) {
            res.writeHead(404, { 'Content-Type': 'application/json' });
            res.end(JSON.stringify({ ok: false, error: 'TODO not found' }));
            return;
          }
          res.writeHead(200, { 'Content-Type': 'application/json' });
          res.end(JSON.stringify({ ok: true, todo }));
        } catch (e) {
          res.writeHead(400, { 'Content-Type': 'application/json' });
          res.end(JSON.stringify({ ok: false, error: 'Invalid JSON body' }));
        }
      });
      return;
    }

    if (pathname.startsWith('/todos/') && method === 'DELETE') {
      const removed = removeTodo(id);
      if (!removed) {
        res.writeHead(404, { 'Content-Type': 'application/json' });
        res.end(JSON.stringify({ ok: false, error: 'TODO not found' }));
        return;
      }
      res.writeHead(200, { 'Content-Type': 'application/json' });
      res.end(JSON.stringify({ ok: true }));
      return;
    }

    res.writeHead(404, { 'Content-Type': 'application/json' });
    res.end(JSON.stringify({ ok: false, error: 'Not Found' }));
  });

  return server;
}

module.exports = createServer;
